import React,{useEffect,useState} from 'react'
import Item from './Item'

async function getJson() {
    var jsonData = await fetch('http://localhost:5000/api/items?by=ID')
     .then(response => response.json())
     .then(data => JSON.parse(data))
     return jsonData
   }

function Itemlist() {

    const [items, setItems] = useState([])

    useEffect(() => {
      const setJson = async () => {
        var jsonRes = await getJson()
        setItems(jsonRes)
      }

      setJson()
    }, [])


    // get the names of all items in the json object
    var nameSet = () => {
        var nameSet = new Set()

        for (const key in items) {
            if (Object.hasOwnProperty.call(items, key)) {
                const element = items[key];
                nameSet.add(element['name'])
            }
        }return nameSet
    }

  return (
    <div>{

        nameSet().forEach(element => {

            <div>{element}</div>

            Object.keys(items).map((keyName, i) => {

                // only return the object if
                if (items[keyName]['name'] === 'PHZ60'){
                    return <Item key={keyName} itemObject={items[keyName]}/>
                }

            }) 
            return
        })
    }
    </div>
  )
}

export default Itemlist
